import React from 'react';
import './Specialty-Skill.css';


class AboutMe extends React.Component {
	constructor(props) {
    super(props);
  }
  render(){
  	const s_s_list=["Networked Control","Machine Learning","Network Science","Embedded System",
  					"Hybrid System","Stochastic System","Python, Flask","C, C++", "React", "AWS","Docker",
  					"Communication"];

  	return(
  		<div class="s-s-container">
  			<div class="main-title">
  			Specialty & Skill
  			</div>
  			<div class="s-s-main">
  				<div class="s-s-wrap">
  					<div class="s-s-title">
  						React
  					</div>
  					<div class="s-s-level-wrap">
  						<div class="s-s-level"></div>
  					</div>
  				</div>

  				<div class="s-s-wrap s-s-wrap-r">
  					<div class="s-s-title">
  						React
  					</div>
  					<div class="s-s-level-wrap">
  						<div class="s-s-level"></div>
  					</div>
  				</div>

  				<div class="s-s-wrap">
  					<div class="s-s-title">
  						React
  					</div>
  					<div class="s-s-level-wrap">
  						<div class="s-s-level"></div>
  					</div>
  				</div>
  			</div>
  		</div>
  	);
  }
}


export default AboutMe;
